import React from 'react';

const CardList = ({pokemons}) => {
	return (
		<div>
			<h1 className='tc'> Pokemon Index </h1>
    		<Card id = {pokemons[0].id} name={pokemons[0].name} img ={pokemons[0].img}/>
    		<Card id = {pokemons[1].id} name={pokemons[1].name} img ={pokemons[1].img}/>
    		<Card id = {pokemons[2].id} name={pokemons[2].name} img ={pokemons[2].img}/>
    		<Card id = {pokemons[3].id} name={pokemons[3].name} img ={pokemons[3].img}/>
    		<Card id = {pokemons[4].id} name={pokemons[4].name} img ={pokemons[4].img}/>
    		<Card id = {pokemons[5].id} name={pokemons[5].name} img ={pokemons[5].img}/>
		</div>
	);
};

export default CardList;
